    true,nt"url": null,nt"notes": "<p>The data set includes the number of eligible
    patients by clinical measure; % patients with Hemoglobin &gt; 12; ESRD QIP data
    by facility: % of hemodialysis patient-months with spKt/V &gt;= 1.2; % of peritoneal
    patient-months with Kt/V &gt;= 1.7 Kt/V (dialytic + residual) during the four-month
    study period; % of pediatric in-center hemodialysis patient-months with spKt/V &gt;=
    1.2; % of hemodialysis patients using an arteriovenous fistula during last treatment
    of the month; % of hemodialysis patients using an intravenous catheter during the
    last treatment of the month and for at least 89 days prior; Hemoglobin &gt; 12 measure
    score; Dialysis Adequacy Measure Topic score; Vascular Access Type Measure Topic
    score; ICH CAHPS Admin score; NHSN Event Reporting score; Mineral Metabolism Reporting
    score; Anemia Management Reporting score; the Total Performance Score; and payment
    reduction percentage.</p>n",nt"license_title": "Other License Specified",nt"extras":
